import "./chart.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer,
} from "recharts";

const data = [
    {
      name: "Monday",
    "ActiveVMs": 4000,
      "InactiveVMs": 2400,
      amt: 2400,
    },
    {
      name: "Tuesday",
    "ActiveVMs": 3000,
      "InactiveVMs": 1398,
      amt: 2210,
    },
    {
      name: "Wednesday",
    "ActiveVMs": 2000,
      "InactiveVMs": 9800,
      amt: 2290,
    },
    {
      name: "Thursday",
    "ActiveVMs": 2780,
      "InactiveVMs": 3908,
      amt: 2000,
    },
    {
      name: "Friday",
    "ActiveVMs": 1890,
      "InactiveVMs": 4800,
      amt: 2181,
    }
  ];





export default function Chart() {
    return (
        <div className="chart">
            <h3 className="chartTitle">Virtual Machines</h3>
            <ResponsiveContainer width="100%" aspect= {6/ 1}>
                <LineChart data={data}>
                    <XAxis dataKey="name" stroke="teal" />
                    <Line type="natural" dataKey="ActiveVMs" stroke ="green" />
                    <Line type="natural" dataKey="InactiveVMs" stroke ="red" />
                </LineChart>
            </ResponsiveContainer>

            <h3 className="chartTitle">Network</h3>
            <ResponsiveContainer width="100%" aspect= {6 / 1}>
                <LineChart data={data}>
                    <XAxis dataKey="name" stroke="teal" />
                </LineChart>
            </ResponsiveContainer>
        </div>
    )
}
